function titleCase(str) {

  var array = str.toLowerCase().split(" ");
  for (var i = 0; i < array.length; i++){
    array[i] = array[i][0].toUpperCase() + array[i].substring(1, array[i].length);
  }
  var string = array.join(" ");

  return string;
}

function InquiryName(rawName){
	CapName = titleCase(rawName);
	Amount = Enumerable.From(dataSet).Where(function (x) { return x.name == CapName }).Select(function (x) { return x.count }).ToArray();
	if (Amount[0] == null) {
		Amount[0] = 0;
	}
	return parseInt(Amount[0]);
}

$("#InquiryBtn").click(function(){
	$("#amountPlace").text(InquiryName($("#EnglishName").val()));
	$("#amountCard").removeClass('invisible');
})
